/*Table structure for table `employee_data` */

DROP TABLE IF EXISTS `employee_data`;

CREATE TABLE `employee_data` (
  `Id` varchar(9) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
  `Name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `Email_address` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `Phone_number` varchar(10) DEFAULT NULL,
  `Gender` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `FK_CafeId` int DEFAULT NULL,
  PRIMARY KEY (`Id`),
  KEY `FK_CafeId` (`FK_CafeId`),
  CONSTRAINT `employee_data_ibfk_1` FOREIGN KEY (`FK_CafeId`) REFERENCES `cafe_data` (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

