/* Procedure structure for procedure `sp_DeleteCafe` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_DeleteCafe` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_DeleteCafe`(
    IN p_Id INT -- The ID of the cafe to be deleted
)
BEGIN
    -- Delete the cafe record from cafe_data table
    DELETE FROM `cafemanage`.`cafe_data`
    WHERE `Id` = p_Id;
    
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_DeleteEmployee` */

